  from discrete sample and profile observations using CTD, bottle and other instruments
  from the Hakuho Maru in the North Pacific Ocean and South Pacific Ocean from 1991-08-13
  to 1991-09-01 (NODC Accession 0115591)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
