  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115591 includes chemical,
  discrete sample, physical and profile data collected from Hakuho Maru in the North
  Pacific Ocean and South Pacific Ocean from 1991-08-13 to 1991-09-01 and retrieved
  during cruise KH91-5_1, PACIFICA_49HH19910813 and WOCE P13C. These data include
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, Potential temperature (theta), SALINITY
  and WATER TEMPERATURE. The instruments used to collect these data include CTD and
  bottle. These data were collected by Shuichi Watanabe of Japan Agency for Marine-Earth
  Science and Technology (JAMSTEC) and Keisuke Taira of Tokyo University as part of
  the PACIFICA_49HH19910813 data set.nnPACIFICA (PACIFic ocean Interior CArbon) was
  an international collaborative project for the data synthesis of ocean interior
  carbon and its related parameters in the Pacific Ocean. The North Pacific Marine
  Science Organization (PICES), Section of Carbon and Climate (S-CC) supported the
  project.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
